interface MyComponentProps {
  selectedItem: string;
  href?: string;
}

const A_Component: React.FC<MyComponentProps> = ({
  selectedItem,
  href = "#",
}) => {
  const handleClick = (e: React.MouseEvent<HTMLAnchorElement, MouseEvent>) => {
    e.preventDefault();
    const categoryTitle = document.getElementById("categoryTitle");
    if (categoryTitle) {
      categoryTitle.textContent = selectedItem;
    }
  };

  return (
    <>
      {href === "#" ? (
        <a href="#" className="clickLink" onClick={handleClick}>
          {itemIcons[selectedItem]} {selectedItem}
          <input hidden name="input" value={selectedItem} />
        </a>
      ) : (
        <a href={href} target="_blank">
          {itemIcons[selectedItem]} {selectedItem}
        </a>
      )}
    </>
  );
};

export { A_Component, itemIcons };
